import './App.css';
import Links from "./components/Links";
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

function App() {
  return (
    <>
      <div className='container p-4' >
        <div className='column'>
          <Links />
        </div>
        <ToastContainer />
      </div>
    </>
  );
}

export default App;
